/*Table structure for table t_dict_region 

DROP TABLE IF EXISTS t_dict_region;
CREATE TABLE t_dict_region (
  c_id varchar(36) NOT NULL COMMENT '唯一标识符',
  c_name varchar(200) DEFAULT NULL COMMENT '名称',
  c_parent_id varchar(36) DEFAULT NULL COMMENT '上级地理位置ID',
  c_level int(2) DEFAULT NULL COMMENT '树层级',
  c_path varchar(350) DEFAULT NULL COMMENT '树级路径',
  -- , 形式:1,5,3:表示当前节点为三级节点, 三个序号从右向左为当前节点, 父节点, 父节点的父级也即是一级节点所对应的路径序号, 序号用自然数表示, 同级节点每增加一个序号加1, 当前节点序号与上级序号以","分隔.
  c_full_path_name varchar(500) DEFAULT NULL COMMENT '全路径名称',
  c_config varchar(500) DEFAULT NULL COMMENT '扩展信息',
  c_sort_id int(10) NOT NULL  COMMENT '排序号',
  c_tag1 VARCHAR(200) COMMENT '冗余字段1',
  c_tag2 VARCHAR(200) COMMENT '冗余字段2',
  PRIMARY KEY (c_id)
) ENGINE=InnoDB DEFAULT CHARSET=gbk COMMENT='区域表';

